import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import './index.css'
import contact from './contacts'
import Xam from './Xam'
import * as cal from './Heading'
import Taothe from './taothe'
import {  BrowserRouter as Router,Route, Routes, Link, Navigate} from 'react-router-dom'

var ccc = window.location.pathname

function App() {
  return (
    <Router>
      <div>
        <Link to="/taothe" onClick = {window.location.reload()}>the</Link>
      </div>
      <Routes> 
       <Route  path = "/taothe" element = {<Taothe/>} />
       <Route  path = {ccc} element = {<Xam/>} />
      </Routes>    
  </Router>
  )
 }

export default App;
